import React from "react";
import styled from "styled-components";

export const Container = styled.div`
  background-color: white;
  padding-top: 23px;
`;

const Tr = styled.tr`
  height: 54px;
  padding: 16px 0 0;
  background-color: #ffffff;
  border: 1px solid #e9e9e9;

  > td span {
    margin-left: 30px;
    font-family: PingFangSC;
    font-size: 14px;
    line-height: 1.57;
    color: rgba(0, 0, 0, 0.65);
  }
`;

const tableTitles = [
  { title: "Date/Time" },
  { title: "Name" },
  { title: "Device" },
  { title: "Payment" },
  { title: "BIN Number" },
  { title: "Amount" },
  { title: "Trans ID" },
  { title: "Decision" },
];

const TableHeaders = styled.tr`
  height: 54px;
  padding: 16px 60px 16px 32px;
  background-color: #fafafa;
`;

const TableHeader = styled.th`
  font-family: PingFangSC;
  font-size: 14px;
  font-weight: 500;
  line-height: 1.57;
  color: rgba(0, 0, 0, 0.65);
  text-align: left;

  > span {
    margin: 0 32px 0 32px;
  }
`;
const Table = styled.table`
  width: 100%;
  margin-left: 32px;
  border-collapse: collapse;
`;

const tableContent = [
  {
    date: "2019-06-22 16:32:03",
    name: "Mandy Unsworth",
    device: "C",
    payment: "visa",
    binNumber: "234567",
    amount: "30$",
    transId: "5d909a2417…",
    decision: "Approved",
  },
  {
    date: "2019-06-22 21:03:17",
    name: "Graham Griffiths",
    device: "M",
    payment: "amex",
    binNumber: "638913",
    amount: "35$",
    transId: "763a677958...",
    decision: "Declined",
  },
  {
    date: "2019-06-22 16:32:03",
    name: "Mandy Unsworth",
    device: "C",
    payment: "visa",
    binNumber: "234567",
    amount: "30$",
    transId: "5d909a2417…",
    decision: "Approved",
  },
  {
    date: "2019-06-22 21:03:17",
    name: "Graham Griffiths",
    device: "M",
    payment: "amex",
    binNumber: "638913",
    amount: "35$",
    transId: "763a677958...",
    decision: "Declined",
  },
  {
    date: "2019-06-22 16:32:03",
    name: "Mandy Unsworth",
    device: "C",
    payment: "visa",
    binNumber: "234567",
    amount: "30$",
    transId: "5d909a2417…",
    decision: "Approved",
  },
];
const renderTableHeader = () => {
  let header = Object.keys(tableTitles);
  return header.map((key, index) => {
    return (
      <TableHeader key={index}>
        <span>{tableTitles[key].title}</span>
      </TableHeader>
    );
  });
};

const renderTableData = () => {
  return tableContent.map((transaction, index) => {
    const {
      date,
      name,
      device,
      payment,
      binNumber,
      amount,
      transId,
      decision,
    } = transaction;
    return (
      <Tr key={index}>
        <td>
          <span>{date}</span>
        </td>
        <td>
          <span>{name}</span>
        </td>
        <td>
          <span>{device}</span>
        </td>
        <td>
          <span>{payment}</span>
        </td>
        <td>
          <span>{binNumber}</span>
        </td>
        <td>
          <span>{amount}</span>
        </td>
        <td>
          <span>{transId}</span>
        </td>
        <td>
          <span>{decision}</span>
        </td>
      </Tr>
    );
  });
};
const TransactionLog = () => {
  return (
    <Container>
      <Table>
        <tbody>
          <TableHeaders>{renderTableHeader()}</TableHeaders>
          {renderTableData()}
        </tbody>
      </Table>
      {/* <TableHead>
        <tr>
          {tableTitles.map(({ title }) => (
            <ThContainer>
              <th>{title}</th>
            </ThContainer>
          ))}
        </tr>
      </TableHead> */}
      {/* {renderTableData()} */}
    </Container>
  );
};

export default TransactionLog;
